import React from 'react';

import { Container, LinkItem } from './styles';

function MenuBar() {
  return (
    <Container>
      <LinkItem>Classes</LinkItem>
      <LinkItem>About</LinkItem>
    </Container>
  );
}

export default MenuBar;
